INSERT INTO `tsys_config` (`type`,`ckey`,`cvalue`,`updater`,`update_datetime`,`remark`,`company_code`,`system_code`) VALUES ('sys_txt','about_us','<p>關於可盈可樂</p><p>可盈可樂是個人與個人之間交易比特幣的場外交易平台。</p><p>可盈可樂隸屬於香港CoinCola Limited,由專業的國際化團隊研發與運營，專注於為全球用戶提供便捷,可依賴的區塊鏈服務。 CoinCola匯聚全球用戶，致力於打造世界級的區塊鏈資產平台。</p><p>在可盈可樂，來自不同國家的人們可以用本國貨幣購買到比特幣。網站的賣家發佈出售比特幣的廣告，並說明付款方式和匯率。您可根據廣告內容選擇直接在線交易。比特幣都存放在可盈可樂的網絡錢包裡，您可以直接進行比特幣轉賬。</p><p>CoinCola，是一個自由買賣安全可信賴的OTC交易平台。我們希望人們交易和使用比特幣變得更加簡單。越來越多的人更願意通過場外交易方式購買和出售比特幣，因為這種方式更加快速，而且支持各種不同的付款方式。實時競價的比特幣交易所往往比較慢且麻煩。因此，我們讓使用相同付款方式的人們建立聯繫進行交易會加快資金轉移速度。</p><p>&nbsp;</p><p>為什麼選擇可盈可樂</p><p>快速買賣</p><p>CoinCola是一個不涉及第三方的P2P交易平台，交易過程方便快捷。</p><p>安全可靠</p><p>冷存儲、SSL、多重加密等銀行級別安全技術，十年金融安全經驗的安全團隊。</p><p>及時掌控</p><p>WEB、APP行情及時掌握，交易隨時隨地。</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n更簡單易懂的產品設計，幫助您快速和簡單地進行比特幣交易。&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n我們安全的託管保護系統可以同時保護買家和賣家。&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n強大的搜索功能可以幫助您找到合適的交易者。&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n冷存儲、SSL、多重加密等銀行級別安全技術，保障您的比特幣安全存儲。&nbsp;</p><p>&nbsp;</p><h1>使用CoinCola產品的相關費用說明</h1><p>註冊CoinCola是完全免費的，而且您將獲得一個免費的在線比特幣錢包。不需要安裝任何應用即可使用。&nbsp;\r\n從CoinCola市場上購買和出售比特幣完全免費。&nbsp;\r\n發布交易廣告的CoinCola用戶每筆完成的交易需要繳納&nbsp;0.7%&nbsp;的費用。&nbsp;\r\n與其他CoinCola用戶的錢包進行轉賬交易免費。&nbsp;\r\n與其他比特幣錢包進行交易需要繳納比特幣網絡轉賬費。費用多少會根據比特幣區塊鏈當前的使用率有所變化，我們會根據當前網絡阻塞情況自動調整此費用，以確保您的交易能夠盡快得到確認。您發送交易後，交易費將從您的CoinCola錢包中扣除。&nbsp;\r\n當前與其他比特幣錢包之間的網絡手續費約為&nbsp;0.0009&nbsp;BTC。網絡手續費按筆計。&nbsp;</p><p>&nbsp;</p><p>成為我們的合作夥伴</p><p>可盈可樂正在尋求同樣希望看到比特幣經濟增長的合作夥伴。</p><p>您也看好比特幣嗎？可盈可樂一直在尋找願意把比特幣發展到一個新的水平的加盟者和合作夥伴。無論您在哪裡，都歡迎您加入我們。</p><p>·\r\n擁有比特幣或進行比特幣交易？&nbsp;<a href=\"https://www.coincola.com/new-ad\">創建</a>一個出售或者購買比特幣的廣告，大額交易可以與客服團隊聯繫合作優惠。聯繫方式:&nbsp;<a href=\"mailto:contact@coincola.com\">contact@coincola.com</a></p><p>·\r\n<a href=\"https://www.coincola.com/activities/invite\">成為CoinCola的會員</a>可以從每一個您新帶來網站的訪問者中掙得比特幣。</p><p>&nbsp;</p><p><br></p>','admin',now(),'关于我们','CD-COIN000017','CD-COIN000017');
