INSERT INTO `tsys_config` (`type`,`ckey`,`cvalue`,`updater`,`update_datetime`,`remark`,`company_code`,`system_code`) VALUES ('sys_txt','questions','<p>為什麼我的比特幣價格和交易廣告中的不同？</p><p>目前發布的廣告的價格是基於各大知名實時交易所的價格均衡算出的一種價格，可以大概反映出市場價，這個價格是會不斷被更新的，以便讓您的廣告保持趨於合理的範圍內。</p><p>我不慎標記付款為完成，但沒有支付</p><p>如果您沒有完成支付，請取消交易並在您準備好支付後發起一個新的交易請求。標記付款為完成的交易將導致比特幣被鎖定在託管中賣家無法出售它們。&nbsp;\r\n未付款卻不慎標記付款為完成，且不主動取消購買，將導致您的用戶帳戶得到負面的評價。 CoinCola會對此類行為的賬戶進行限製或關閉。&nbsp;</p><p>我不知道該如何支付，而且我也看不懂有關付款的說明</p><p>一般賣家會設置詳細的付款信息。有時賣家只會披露部分信息，例如接收方銀行帳戶名稱等，更詳細的信息需要下單之後賣家才會提供。如果您不知道如何按照給定信息支付，請聯繫賣家溝通以獲得進一步的指示。</p><p>我已付款，但没有按下標記“已完成付款”按鈕</p><p>如果您把錢付給了賣家，一定記得在付款期限內標記已付款。</p><p>&nbsp;</p><p>如果沒有在付款期限內標記付款為已完成， 您可以使用聊天框聯繫賣家重新開啟交易。、\r\n重新開啟的交易將再次得到託管的保護，直到賣家確認您的付款已經到達他的賬戶。</p><p>我已經下單，但無法在給定的時間期限內支付</p><p>請取消交易或留言給賣家，說明您無法及時付款。賣家可以在您準備好付款以後重新開啟交易。</p><p>&nbsp;</p><p><br></p>','admin',now(),'常见问题','CD-COIN000017','CD-COIN000017');
